import React from "react";
import "../index.css";

function Tutorial() {
  return (
    <p>
      To TeX summation notation, use the \sum command. Input expressions below or above the summation using the _ and ^ characters respectively, like so: $\sum_&#123;n=0&#125;^
    </p>
  );
}

export default Tutorial;
